import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Login from "./lpogin/Login";

function ProjectRoute() {
    return(
        <Router>
            <Routes>
                <Route path="/login" element={<Login />}/>
            </Routes>
        </Router>
    )
}

export default ProjectRoute;
